import styled from 'styled-components';
export const Drop = styled.div`
padding: 50px 0;
    text-align: center
`;
export const Droptitle = styled.h2`
font-size: 60px;
    margin-bottom: 30px
    span {
        font-weight: normal
    }
    @media (max-width:575px) {
            font-size: 40px
        }
`;
